import Button from '../../UI/Button';

const CartItem = (props) => {

const [number, setNumber] = useState(props.number);

  return (
    <li>
      <h3>{props.name}</h3>
      <p>{props.price}</p>
      <p>{number}</p>
      <p>{props.amount}</p>
      <Button buttonLabel='+' />
      <Button buttonLabel='-' />
    </li>
  );
};

export default CartItem;
